webpackJsonp([0x6cfc26cde058],{2751:function(l,a){l.exports={pathContext:{docHtml:'<h1>is-installed-globally <a href="https://travis-ci.org/sindresorhus/is-installed-globally"><img src="https://travis-ci.org/sindresorhus/is-installed-globally.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Check if your package was installed globally</p>\n</blockquote>\n<p>Can be useful if your CLI needs different behavior when installed globally and locally.</p>\n<h2>Install</h2>\n<pre><code>$ npm install is-installed-globally\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">const isInstalledGlobally = require(\'is-installed-globally\');\n\n// With `npm install your-package`\nconsole.log(isInstalledGlobally);\n//=> false\n\n// With `npm install --global your-package`\nconsole.log(isInstalledGlobally);\n//=> true\n</code></pre>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/import-global">import-global</a> - Import a globally installed module</li>\n<li><a href="https://github.com/sindresorhus/resolve-global">resolve-global</a> - Resolve the path of a globally installed module</li>\n<li><a href="https://github.com/sindresorhus/global-dirs">global-dirs</a> - Get the directory of globally installed packages and binaries</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/is-installed-globally/readme",proj:"argo-ci"}}}});
